import React, { Component } from "react";
import "../App.css";
import ReactPlayer from "react-player";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import CardMedia from "@material-ui/core/CardMedia";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
  },
  details: {
    display: "flex",
    flexDirection: "column",
  },
  content: {
    flex: "1 0 auto",
  },
  cover: {
    width: 151,
  },
  controls: {
    display: "flex",
    alignItems: "center",
    paddingLeft: theme.spacing(1),
    paddingBottom: theme.spacing(1),
  },
  playIcon: {
    height: 38,
    width: 38,
  },
}));

export default function Videos() {
  const classes = useStyles();
  const theme = useTheme();
  return (
    <body>
      <div className="center">
        <List>
          <ListItem>
            <ReactPlayer
              url="https://www.youtube.com/watch?v=bS2ECh9Sees&list=LLbucXVn_RwkN7vgdWv_Pukw&index=2&t=0s"
              playing
            />
          </ListItem>
          <ListItem>
            <ReactPlayer
              url="https://www.youtube.com/watch?v=LdHprvhehrQ&list=LLbucXVn_RwkN7vgdWv_Pukw&index=3&t=0s"
              playing
            />
          </ListItem>
          <ListItem>
            <ReactPlayer
              url="https://www.youtube.com/watch?v=uRilip0v9e8&list=LLbucXVn_RwkN7vgdWv_Pukw&index=21&t=0s"
              playing
            />
          </ListItem>
          <ListItem>
            <ReactPlayer
              url="https://www.youtube.com/watch?v=9m4v1PPPv90&list=LLbucXVn_RwkN7vgdWv_Pukw&index=22&t=0s"
              playing
            />
          </ListItem>
        </List>
      </div>
    </body>
  );
}
